    // 校验逻辑关系是否正确
    customGroupSearchComponent.prototype.checkLogicalExpression = function () {
        var _this = this;
        var params = {
            logicalExpression: this.searchContent
        };
        var configParam = {
            httpService: this.searchHttpService,
            loadingFlag: true,
            messageFlag: false,
            inputParam: params,
            message: this.messageService,
            injectName: 'checkLogicalExpression',
            loadingShow: this.loadingShow,
            messageInfo: '保存成功',
        };
        this.commonFunc.haddleData(configParam, function (bodyData) {
            if (bodyData) {
                if (bodyData.result === 'true') { // 如果逻辑关系正确，则执行高级搜索函数
                    _this.doSearch();
                }
                else if (bodyData.result === 'false') { // 逻辑关系不正确，不执行高级搜索
                    _this.messageService.clear();
                    _this.messageService.add({ severity: 'error', summary: '提示', detail: "\u8BF7\u8F93\u5165\u5408\u7406\u7684\u903B\u8F91\u5173\u7CFB" });
                }
            }
        });
    };
