    // 用户选择一条联想出来的指标，判断指标类型，显示不同的模板
    DoSearchComponent.prototype.selectContent = function (data, isChange) {
        this.isChange = false; // 将isChange置为false
        if (this.modelData.length !== 0) { // 当条件模板数量大于1时，显示逻辑选择的按钮
            this.logicFlag = true;
        }
        if (!isChange) { // 第一次页面初始化
            this.inputFlag = false; // 初始化展示的输入框消失
            this.templateFlag = true; // 条件完善模板出现
            this.searchContent = ''; // 将输入条件框中的数据清空
            this.lenovoData = []; // 将联想数据清空
        }
        // 根据选择的指标编号，判断显示具体的条件完善模板
        if (data) {
            switch (data.showType) {
                case '01': // 01---精确匹配模板
                    this.modelData.push({ indicatorName: data.indicatorName, indicatorId: data.indicatorId, indicatorValueCn: '', indicatorValue: '', valueType: '01', showType: data.showType });
                    break;
                case '02': // 02---模糊匹配模板
                    this.modelData.push({ indicatorName: data.indicatorName, indicatorId: data.indicatorId, indicatorValueCn: '', indicatorValue: '', valueType: '04', showType: data.showType });
                    break;
                case '03': // 03---是否选择模板
                    this.modelData.push({ indicatorName: data.indicatorName, indicatorId: data.indicatorId, indicatorValueCn: '', indicatorValue: '1', valueType: '02', showType: data.showType });
                    break;
                case '04': // 04---简单码值模板
                    this.modelData.push({ indicatorName: data.indicatorName, indicatorId: data.indicatorId, indicatorValueCn: '', indicatorValue: '', valueType: '01', showType: data.showType, indicatorApplParam: data.indicatorApplParam });
                    break;
                case '05': // 05---复杂码值模板
                    this.modelData.push(
                    // customGroup
                    // optionalCustomGroup
                    { indicatorName: data.indicatorName, indicatorId: data.indicatorId, indicatorValueCn: '', indicatorValue: '', valueType: '01', showType: data.showType, indicatorApplParam: data.indicatorApplParam });
                    break;
                case '06': // 06---特殊码值模板
                    this.modelData.push({ indicatorName: data.indicatorName, indicatorId: data.indicatorId, indicatorValueCn: '', indicatorValue: '', valueType: '01', showType: data.showType, indicatorApplParam: data.indicatorApplParam });
                    break;
                case '07': // 07---金额区间模板
                    this.modelData.push({ indicatorName: data.indicatorName, indicatorId: data.indicatorId, indicatorValueCn: '', indicatorValue: '1', valueType: '10', startNum: '', endNum: '', showType: data.showType });
                    break;
                case '08': // 08---时间区间模板
                    this.modelData.push({ indicatorName: data.indicatorName, indicatorId: data.indicatorId, indicatorValueCn: '', indicatorValue: 'this.searchStartDate,searchEndDate', valueType: '10', startDate: this.searchStartDate, endDate: this.searchEndDate, showType: data.showType });
                    break;
                case '09': // 09---持有标识模板
                    this.modelData.push({ indicatorName: data.indicatorName, indicatorId: data.indicatorId, indicatorEnName: data.indicatorEnName, indicatorValueCn: '', indicatorValue: '1', valueType: '12', showType: data.showType });
                    break;
                default: break;
            }
        }
    };
