    // 执行高级查询  拼装参数
    DoSearchComponent.prototype.doQuery = function () {
        var _this = this;
        try {
            this.modelData.forEach(function (el, index) {
                if (el.indicatorValue || el.valueType === '08' || el.valueType === '09') {
                    _this.selectFlag = true;
                    el.seqId = index + 1 + ''; // 添加条件序号
                    switch (el.showType) {
                        case '01':
                            el.showDesc = el.indicatorName + '(' + el.indicatorValue + ')';
                            el.description = el.showDesc;
                            el.indicatorValueCn = el.indicatorValue;
                            break;
                        case '02':
                            _this.returnLabel(el.valueType);
                            el.showDesc = el.indicatorName + '(' + _this.valueLabel + '“' + el.indicatorValue + '”' + ')';
                            el.description = el.showDesc;
                            el.indicatorValueCn = el.indicatorValue;
                            break;
                        case '03':
                            if (el.indicatorValue === '1') {
                                el.indicatorValueCn = '是';
                            }
                            else if (el.indicatorValue === '0') {
                                el.indicatorValueCn = '否';
                            }
                            el.showDesc = el.indicatorName + '(' + el.indicatorValueCn + ')';
                            el.description = el.showDesc;
                            break;
                        case '04':
                            el.showDesc = el.indicatorName + '(' + el.indicatorValueCn + ')';
                            el.description = el.showDesc;
                            break;
                        case '05':
                            el.showDesc = el.indicatorName + '(' + el.indicatorValueCn + ')';
                            el.description = el.showDesc;
                            break;
                        case '06':
                            el.showDesc = el.indicatorName + '(' + el.indicatorValueCn + ')';
                            el.description = el.showDesc;
                            break;
                        case '07':
                            if (el.startNum !== null) {
                                el.startNum = el.startNum + '';
                            }
                            if (el.endNum !== null) {
                                el.endNum = el.endNum + '';
                            }
                            if (!el.startNum && !el.endNum) {
                                el.indicatorValue = '1';
                                el.indicatorValueCn = el.indicatorValue + ',∞';
                            }
                            else if (!el.startNum && el.endNum) {
                                el.indicatorValue = '1,' + el.endNum;
                                el.indicatorValueCn = el.indicatorValue;
                            }
                            else if (el.startNum && !el.endNum) {
                                el.indicatorValue = el.startNum + '';
                                el.indicatorValueCn = el.startNum + ',∞';
                            }
                            else {
                                el.indicatorValue = el.startNum + ',' + el.endNum;
                                el.indicatorValueCn = el.indicatorValue;
                            }
                            el.showDesc = el.indicatorName + '(' + el.indicatorValueCn + ')';
                            el.description = el.showDesc;
                            break;
                        case '08':
                            // if()
                            el.startDate = _this.commfunc.transDateN(el.startDate);
                            el.endDate = _this.commfunc.transDateN(el.endDate);
                            if (el.startDate !== '' && el.endDate === '') {
                                el.indicatorValue = el.startDate;
                            }
                            else if (el.startDate === '' && el.endDate !== '') {
                                el.indicatorValue = el.endDate;
                            }
                            else if (el.startDate !== '' && el.endDate !== '') {
                                el.indicatorValue = el.startDate + ',' + el.endDate;
                            }
                            el.indicatorValueCn = el.indicatorValue;
                            el.showDesc = el.indicatorName + '(' + el.indicatorValueCn + ')';
                            el.description = el.showDesc;
                            break;
                        case '09':
                            if (el.indicatorValue === '1') {
                                el.indicatorValueCn = '是';
                            }
                            else if (el.indicatorValue === '0') {
                                el.indicatorValueCn = '否';
                            }
                            el.showDesc = el.indicatorName + '(' + el.indicatorValueCn + ')';
                            el.description = el.showDesc;
                            break;
                        default:
                            break;
                    }
                }
                else {
                    _this.messageService.clear();
                    _this.messageService.add({ severity: 'error', summary: '提示', detail: "\u8BF7\u5B8C\u5584\u7B2C" + (index + 1) + "\u4E2A\u6761\u4EF6" });
                    _this.selectFlag = false;
                    throw new Error(); // new 一个error跳出foreach
                }
            });
        }
        catch (error) {
            // console.log(error);
        }
        if (this.selectFlag) {
            var params = {
                businessId: 'C0001',
                queryRange: this.customType,
                dataDt: this.chooseMonthMain,
                indicatorList: this.modelData,
            };
            if (this.modelData.length > 1) { // 当指标列表中的条件大于一条的时候   传逻辑条件和逻辑描述
                params['logicType'] = this.logicType; // 逻辑类型
                params['logicDesc'] = this.logicMs; // 逻辑描述
            }
            // 非其他跳转入口
            if (!this.lifeFlag) {
                this.commfunc.setSessionDataCH('searchCondition', JSON.stringify(params)); // 将组合起来的查询条件存储到session中
                this.router.navigate(['pages/tzb/custom/custom-search/search-result-pages']); // 跳转至搜索结果页面
            }
            else {
                this.commfunc.setSessionDataCH('searchCondition', JSON.stringify(params));
                var poolParam = {
                    type: 'lifeCycle',
                    marketingCampaignId: this.marketingCampaignId,
                    suggestContactCycle: this.routeInfo.snapshot.params['suggestContactCycle'],
                    receivePersonOrg: this.routeInfo.snapshot.params['receivePersonOrg'],
                    marketTopic: this.routeInfo.snapshot.params['marketTopic'],
                    instancyDegree: this.routeInfo.snapshot.params['instancyDegree'],
                    dataDt: this.commfunc.transDateN(new Date()),
                    custSource: this.routeInfo.snapshot.params['custSource'],
                    dataSource: this.routeInfo.snapshot.params['dataSource'],
                    taskFlag: this.routeInfo.snapshot.params['taskFlag'],
                };
                this.router.navigate(['pages/tzb/custom/custom-search/search-result-pages'], {
                    queryParams: { data: JSON.stringify(params), poolParam: JSON.stringify(poolParam) },
                });
            }
        }
    };
